import React, { useEffect, useState, useContext } from 'react';
import { useParams } from 'react-router-dom'; // useParams 훅을 가져옵니다.
import { AuthContext } from '../AuthContext'; // 인증 정보를 가져옵니다.
import API_BASE_URL from '../Config';
import './PatientInfo.css';

const PatientInfo = ({ patientData }) => {
  return (
    <div className="patient-info">
      <h2>환자 정보</h2>
      <p>UUID: {patientData.uuid}</p>
      <p>Name: {patientData.name}</p>
      <p>성별: {patientData.gender}</p>
      <p>연락처: {patientData.phone}</p>
      <p>E-mail: {patientData.email}</p>
      <p>Birth: {patientData.birth}</p>
      <p>마지막 내원일: {patientData.lastAppointmentAt || '내원 기록 없음'}</p>
    </div>
  );
};

export default PatientInfo;
